  console.log('Server started on port 3001');
});
```
This code sets up a basic Express.js server that listens on port 3001 and responds to GET requests to the root URL with a simple message.

Step 3: Create a RESTful API

Create a new file called `api.js` in the root of your project directory:
```
const express = require('express');
const app = express();

app.get('/api/data', (req, res) => {
  const data = [
    { id: 1, name: 'John', age: 30 },
    { id: 2, name: 'Jane', age: 25 },
    { id: 3, name: 'Bob', age: 40 },
  ];
  res.json(data);
});

