Step 4: Connect the React App to the Node and Express.js Server

In your React app, create a new file called `api.js` in the `src` directory:
```
import axios from 'axios';

const api = axios.create({
  baseURL: 'http://localhost:3001/api',
});

export default api;
```
This code sets up an Axios instance that points to the Node and Express.js server.

Step 5: Use the API in Your React App

In your React app, create a new component called `DataList.js` in the `src` directory:
```
import React, { useState, useEffect } from 'react';
import api from './api';

const DataList = () => {
  const [data, setData] = useState([]);

  useEffect(() => {
    api.get('/data')
      .then(response => {
        setData(response.data);
      })
      .catch(error => {
        console.error(error);
      });
  }, []);

  return (
    <ul>
      {data.map(item => (
        <li key={item.id}>{item.name} ({item.age})</li>
      ))}
    </ul>
  );
};

export default DataList;
```
