In C, static variables and register variables are two types of variables that have different storage classes and are used in different contexts.
Static Variables:
A static variable is a variable that retains its value between function calls. It is initialized only once, when the program starts, and retains its value until the program terminates. Static variables are declared using the static keyword.
Here is an example of a static variable:
```
#include <stdio.h>

static int x = 10;

void foo() {
    printf("%d\n", x);
}

int main() {
    foo();
    return 0;
}
```
In this example, the variable `x` is declared as static, which means it retains its value between function calls. When the program starts, `x` is initialized to 10, and when the `foo()` function is called, it prints the value of `x`, which is 10.

Register Variables:
A register variable is a variable that is stored in a register, which is a small amount of memory that is built into the CPU. Register variables are declared using the register keyword.
Here is an example of a register variable:
```
#include <stdio.h>

register int x = 10;

void foo() {
    printf("%d\n", x);
}

int main() {
    foo();
    return 0;
}
```
In this example, the variable `x` is declared as a register variable, which means it is stored in a register. When the `foo()` function is called, it prints the value of `x`, which is 10.

Note that register variables are not guaranteed to be stored in a register

